import React, { useState, useEffect } from 'react';
import { Github, Mail, MapPin, Star, GitFork, ExternalLink, Users, Code, Loader } from 'lucide-react';
import './App.css';

export default function Portfolio() {
  const [portfolio, setPortfolio] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchPortfolio();
  }, []);

  const fetchPortfolio = async () => {
    try {
      const response = await fetch('http://127.0.0.1:5000/api/portfolio');
      if (!response.ok) throw new Error(`API Error: ${response.status}`);

      const contentType = response.headers.get('content-type');
      if (!contentType || !contentType.includes('application/json')) {
        throw new Error('API returned HTML instead of JSON - check if Flask is running on port 5000');
      }

      const data = await response.json();
      setPortfolio(data);
    } catch (err) {
      setError(err.message);
      console.error('Portfolio fetch error:', err);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="loading-content">
          <Loader className="loading-spinner" />
          <p>Loading portfolio...</p>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="error-container">
        <div className="error-content">
          <p className="error-message">Error: {error}</p>
          <button onClick={fetchPortfolio} className="retry-button">
            Retry
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="portfolio">
      {/* Hero Section */}
      <section className="hero">
        <div className="hero-gradient"></div>
        <div className="hero-content">
          {portfolio?.avatar_url && (
            <img
              src={portfolio.avatar_url}
              alt={portfolio.name}
              className="avatar"
            />
          )}
          <h1 className="hero-title">
            {portfolio?.name || 'Developer'}
          </h1>
          <p className="hero-subtitle">
            {portfolio?.title}
          </p>
          <p className="hero-bio">
            {portfolio?.bio}
          </p>

          {/* Stats */}
          <div className="stats">
            <div className="stat">
              <div className="stat-number repos">{portfolio?.public_repos || 0}</div>
              <div className="stat-label">Repositories</div>
            </div>
            <div className="stat">
              <div className="stat-number stars">{portfolio?.total_stars || 0}</div>
              <div className="stat-label">Stars</div>
            </div>
            <div className="stat">
              <div className="stat-number followers">{portfolio?.followers || 0}</div>
              <div className="stat-label">Followers</div>
            </div>
          </div>

          {/* Contact Links */}
          <div className="contact-links">
            {portfolio?.github_url && (
              <a
                href={portfolio.github_url}
                target="_blank"
                rel="noopener noreferrer"
                className="contact-link github-link"
              >
                <Github size={20} />
                <span>GitHub</span>
              </a>
            )}
            {portfolio?.email && (
              <a
                href={`mailto:${portfolio.email}`}
                className="contact-link email-link"
              >
                <Mail size={20} />
                <span>Contact</span>
              </a>
            )}
          </div>
        </div>
      </section>

      {/* Skills Section */}
      {portfolio?.skills && (
        <section className="skills-section">
          <div className="container">
            <h2 className="section-title">Skills & Technologies</h2>
            <div className="skills-grid">
              {portfolio.skills.map((skill, index) => (
                <span key={index} className="skill-tag">
                  {skill}
                </span>
              ))}
            </div>
          </div>
        </section>
      )}

      {/* Projects Section */}
      {portfolio?.projects && portfolio.projects.length > 0 && (
        <section className="projects-section">
          <div className="container">
            <h2 className="section-title">Featured Projects</h2>
            <div className="projects-grid">
              {portfolio.projects.map((project, index) => (
                <div key={index} className="project-card">
                  <div className="project-header">
                    <h3 className="project-title">{project.name}</h3>
                    <div className="project-links">
                      {project.html_url && (
                        <a
                          href={project.html_url}
                          target="_blank"
                          rel="noopener noreferrer"
                          className="project-link"
                        >
                          <Github size={20} />
                        </a>
                      )}
                      {project.homepage && (
                        <a
                          href={project.homepage}
                          target="_blank"
                          rel="noopener noreferrer"
                          className="project-link"
                        >
                          <ExternalLink size={20} />
                        </a>
                      )}
                    </div>
                  </div>

                  <p className="project-description">
                    {project.description}
                  </p>

                  <div className="project-stats">
                    <span className="project-stat">
                      <Code size={16} />
                      <span>{project.language}</span>
                    </span>
                    <span className="project-stat">
                      <Star size={16} />
                      <span>{project.stars}</span>
                    </span>
                    <span className="project-stat">
                      <GitFork size={16} />
                      <span>{project.forks}</span>
                    </span>
                  </div>

                  {project.topics && project.topics.length > 0 && (
                    <div className="project-topics">
                      {project.topics.slice(0, 3).map((topic, i) => (
                        <span key={i} className="topic-tag">
                          {topic}
                        </span>
                      ))}
                    </div>
                  )}
                </div>
              ))}
            </div>
          </div>
        </section>
      )}

      {/* Footer */}
      <footer className="footer">
        <div className="container">
          <div className="footer-content">
            {portfolio?.location && (
              <span className="location">
                <MapPin size={16} />
                <span>{portfolio.location}</span>
              </span>
            )}
          </div>
          <p className="footer-text">
            Built with React & Flask • Data fetched from GitHub API
          </p>
        </div>
      </footer>
    </div>
  );
}
